webpackJsonp([0x8c32070fb814],{3539:function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Value Stream Mapping</h2>\n<p><strong>Value stream mapping</strong> is a lean software development technique. It helps to identity the waste in resources in terms of material, effort, cost and time.  </p>\n<p>Calculating the process cycle efficiency is one of the ways to find out the efficiency of the AS-IS process.</p>\n<p><strong>Process cycle efficiency = Value-added time spent / total cycle time.</strong>   </p>\n<p>The higher the value the better the efficiency.  </p>\n<h4>More Information:</h4>\n<ul>\n<li><a href="https://en.wikipedia.org/wiki/Value_stream_mapping">Wikipedia</a></li>\n</ul>',fields:{slug:"/agile/value-stream-mapping/"},frontmatter:{title:"Value Stream Mapping"}}},pathContext:{slug:"/agile/value-stream-mapping/"}}}});
